import React, { useState } from "react";

function Profile() {
  // Example user data (replace with API data)
  const [user, setUser] = useState({
    name: "Beulah Johnson",
    username: "beulah123",
    email: "beulah@example.com",
    phone: "+1234567890",
    points: 1200,
    activity: [3, 1, 4, 2, 5, 0, 2, 4, 3, 5, 1, 0, 2], // Example weekly activity
  });

  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");

  const handlePasswordChange = () => {
    if (!password || !confirmPassword) {
      alert("Please fill both fields!");
      return;
    }
    if (password !== confirmPassword) {
      alert("Passwords do not match!");
      return;
    }
    alert("Password updated successfully!");
    setPassword("");
    setConfirmPassword("");
  };

  return (
    <div style={styles.container}>
      <h2>User Profile</h2>

      {/* User info */}
      <div style={styles.card}>
        <h3>Personal Info</h3>
        <p><strong>Name:</strong> {user.name}</p>
        <p><strong>Username:</strong> {user.username}</p>
        <p><strong>Email:</strong> {user.email}</p>
        <p><strong>Phone:</strong> {user.phone}</p>
        <p><strong>Current Points:</strong> {user.points}</p>
      </div>

      {/* Edit password */}
      <div style={styles.card}>
        <h3>Change Password</h3>
        <input
          type="password"
          placeholder="New Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          style={styles.input}
        />
        <input
          type="password"
          placeholder="Confirm Password"
          value={confirmPassword}
          onChange={(e) => setConfirmPassword(e.target.value)}
          style={styles.input}
        />
        <button style={styles.button} onClick={handlePasswordChange}>
          Update Password
        </button>
      </div>

      {/* Activity Heat Map */}
      <div style={styles.card}>
        <h3>Activity Heat Map</h3>
        <div style={styles.heatMap}>
          {user.activity.map((score, index) => (
            <div
              key={index}
              style={{
                ...styles.heatCell,
                backgroundColor: `rgba(76, 175, 80, ${0.2 + score * 0.15})`,
              }}
              title={`Day ${index + 1}: ${score} quizzes`}
            ></div>
          ))}
        </div>
      </div>
    </div>
  );
}

const styles = {
  container: {
    padding: "20px",
    fontFamily: "Arial, sans-serif",
  },
  card: {
    backgroundColor: "#f9f9f9",
    padding: "20px",
    marginBottom: "20px",
    borderRadius: "10px",
    boxShadow: "0 2px 5px rgba(0,0,0,0.1)",
  },
  input: {
    display: "block",
    padding: "10px",
    margin: "10px 0",
    borderRadius: "5px",
    border: "1px solid #ccc",
    width: "100%",
    maxWidth: "300px",
  },
  button: {
    padding: "10px 20px",
    borderRadius: "5px",
    border: "none",
    backgroundColor: "#4CAF50",
    color: "#fff",
    cursor: "pointer",
  },
  heatMap: {
    display: "grid",
    gridTemplateColumns: "repeat(7, 30px)",
    gap: "5px",
    marginTop: "10px",
  },
  heatCell: {
    width: "30px",
    height: "30px",
    borderRadius: "4px",
    border: "1px solid #ccc",
  },
};

export default Profile;
